CREATE DEFINER=`9fe69b_dbmcd`@`%` PROCEDURE `GetIncommingItemReport`(IN `purposeInput` VARCHAR(100), IN `StartRoute` VARCHAR(200), IN `fromDate` DATE, IN `toDate` DATE, IN `EndRoute` VARCHAR(200))
Begin
SELECT * FROM `mcdinfo` WHERE `CollectionPurpose`=purposeInput and `VoidStatus`=1 and `RouteEnd`=EndRoute and `RouteStart`=StartRoute and `MCDDate` between fromDate and toDate order by `FlightDate` desc;
END$$

CREATE DEFINER=`9fe69b_dbmcd`@`%` PROCEDURE `GetMCDinfo`(IN `autoSerialInput` VARCHAR(50) CHARSET utf8)
BEGIN
